import React from 'react';
import './Courses.css';

function Courses() {
    return (
        <div className="Courses">
            <h2>Courses Taken</h2>
            <ul>
                <li>Course 1: Introduction to Computer Science</li>
                <li>Course 2: Data Structures and Algorithms</li>
                <li>Course 3: Artificial Intelligence</li>
            </ul>
        </div>
    );
}

export default Courses;
